import React from 'react';
import './App.css';
import { useToggle } from './hooks/useToggle';





function App() {

const[val , func,ref] = useToggle()


  return (


    <div>
      <input ref={ref}></input>
      <button onClick={func}>add</button>
      <div>
        {val.map(function(item,index){
          return <span key={Math.random()}>{item}</span>
        })}

        </div>
    </div>



  );
}

export { App}
